    def find_spanning_tree(edges: List[Tuple[int, int]]) -> List[Tuple[int, int]]:
        def find_parent(parent: List[int], u: int) -> int:
            if parent[u] == u:
                return u
            return find_parent(parent, parent[u])

        def union(parent: List[int], rank: List[int], u: int, v: int):
            u_root = find_parent(parent, u)
            v_root = find_parent(parent, v)
            if u_root == v_root:
                return False
            if rank[u_root] < rank[v_root]:
                parent[u_root] = v_root
            elif rank[u_root] > rank[v_root]:
                parent[v_root] = u_root
            else:
                parent[v_root] = u_root
                rank[u_root] += 1
            return True

        def kruskal(edges: List[Tuple[int, int]]) -> List[Tuple[int, int]]:
            parent = [i for i in range(len(edges) + 1)]
            rank = [0] * (len(edges) + 1)
            edges.sort()
            result = []
            for edge in edges:
                u, v = edge
                if not union(parent, rank, u, v):
                    result.append(edge)
            return result

        return kruskal(edges)

