    n, m = map(int, stdin.split())
    graph = [[] for _ in range(n + 1)]

    for i in range(m):
        u, v = map(int, stdin.split())
        graph[u].append(v)
        graph[v].append(u)

    cycles = set()
    visited = set()
    stack = [0]

    def dfs(node):
        nonlocal cycles, visited, stack

        if node in visited:
            return
        visited.add(node)

        for neighbor in graph[node]:
            if neighbor in visited and neighbor!= node:
                cycles.add(neighbor)
            else:
                stack.append(neighbor)
                dfs(neighbor)
                stack.pop()

        visited.remove(node)

    for i in range(1, n + 1):
        if i not in visited and i!= 1:
            dfs(i)

    return str(len(cycles))


