        remaining_box = boxes[boxes.index(max(boxes, key=lambda box: box[1]))]
        if remaining_box[1] >= objects[index]:
            remaining_box[1] -= objects[index]
            return pack_objects(objects, index + 1, boxes)

        max_index = boxes.index(max(boxes, key=lambda box: box[1]))
        boxes.pop(max_index)
        return pack_objects(objects, index, boxes)

