        for v, u in edges:
            graph[v - 1][u - 1] = 1
            graph[u - 1][v - 1] = 1
        return graph

    def find_spanning_tree(graph: List[List[int]]) -> List[int]:
        def bellman_ford(graph: List[List[int]]) -> int:
            n = len(graph)
            d = [float('inf')] * n
            d[0] = 0
            for _ in range(n - 1):
                for u in range(n):
                    for v in range(n):
                        if graph[u][v] and d[u]!= float('inf') and d[u] + graph[u][v] < d[v]:
                            d[v] = d[u] + graph[u][v]
            for u in range(n):
                if graph[u][u] and d[u]!= float('inf') and d[u] + graph[u][u] < d[u]:
                    return -1
            return d[-1]

        def find_maximum_degree(graph: List[List[int]]) -> int:
            max_degree = 0
            for u in range(n):
                degree = 0
                for v in range(n):
                    if graph[u][v] == 1:
                        degree += 1
                if degree > max_degree:
                    max_degree = degree
            return max_degree

        def dfs(graph: List[List[int]], used: List[bool], parent: int, stack: List[int]) -> None:
            used[parent] = True
            for u in range(n):
                if used[u] == False and graph[parent][u] == 1:
                    dfs(graph, used, u, stack + [u])

        n = len(graph)
        d = bellman_ford(graph)
        if d == -1:
            return []

        max_degree = find_maximum_degree(graph)
        spanning_tree = []
        used = [False] * n
        stack = []
        dfs(graph, used, 0, stack)
        for u in stack:
            if graph[u][u] and d[u] == d[u] - max_degree:
                spanning_tree.append(u + 1)

        return spanning_tree

