def solution(stdin: str) -> str:
    grid = [list(map(int, line.split())) for line in stdin.split('\n')[1:]]
    move = int(stdin.split('\n')[4])

    def merge(x, y):
        nonlocal grid
        if grid[x][y] == 0:
            return False
        elif grid[x][y] == grid[x-1][y] + grid[x+1][y]:
            grid[x][y] += grid[x-1][y] + grid[x+1][y]
            grid[x-1][y] = 0
            grid[x+1][y] = 0
            return True
        elif grid[x][y] == grid[x][y-1] + grid[x][y+1]:
            grid[x][y] += grid[x][y-1] + grid[x][y+1]
            grid[x][y-1] = 0
            grid[x][y+1] = 0
            return True
        else:
            return False

    def is_valid_move(x, y):
        nonlocal grid
        if x < 0 or x >= 4 or y < 0 or y >= 4:
            return False
        elif grid[x][y] == 0:
            return True
        elif grid[x][y] == grid[x][y-1] + grid[x][y+1]:
            return False
        elif grid[x][y] == grid[x-1][y] + grid[x+1][y]:
            return False
        else:
            return False

    directions = {
        0: lambda x, y: (x, y-1),
        1: lambda x, y: (x, y+1),
        2: lambda x, y: (x-1, y),
        3: lambda x, y: (x+1, y),
    }

    x, y = 2, 2
    dx, dy = directions[move]
    while True:
        nx, ny = dx(x, y), dy(x, y)
        if is_valid_move(nx, ny):
            x, y = nx, ny
            if merge(x, y):
                continue
        else:
            break

    return''.join(' '.join(map(str, row)) for row in grid)

