def solution(stdin: str) -> str:
    h, n, m = map(int, stdin.split())
    layer_widths = [2 * (h - i) for i in range(1, h + 1)]
    def f(remaining_bricks: int) -> int:
        if remaining_bricks == 0:
            return 0
        total_bricks = 0
        for width in layer_widths:
            if remaining_bricks >= width:
                total_bricks += width
                remaining_bricks -= width
            else:
                total_bricks += remaining_bricks
                break
        return total_bricks

    def g(remaining_bricks: int) -> int:
        if remaining_bricks == 0:
            return 0
        total_bricks = 0
        for width in reversed(layer_widths):
            if remaining_bricks >= width:
                total_bricks += width
                remaining_bricks -= width
            else:
                total_bricks += remaining_bricks
                break
        return total_bricks

    A = max(f(n + m), g(n + m))
    B = min(f(n), g(n))
    return f"{A} {B}"

