class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next

    @staticmethod
    def from_string(s: str) -> ListNode:
        if not s:
            return None

        head = ListNode.from_string(s[1:])
        node = head
        for _ in range(len(s) - 1):
            node.next = ListNode(int(s[0]), node.next)
            node = node.next

        return head


