            if push <= day:
                pushes[i][push] += 1

    def step_function(n: int) -> int:
        if n == 0:
            return 0
        return 1 + step_function(n - 1)

    def dirtiness(i: int, day: int) -> int:
        return sum(
            pushes[i][day]
            * step_function(day - 1)
            for push in pushes[i]
            if push > day
        )

    def cleanup_phases(i: int) -> int:
